import React from 'react';
import './selectWorkout.scss'
import NativeSelect from '@material-ui/core/NativeSelect';


function SelectWorkout(props) {
    console.log(props.workoutName)

    const handleChange = (event) => {
        const workoutName = event.target.name;
        this.setState({
        //   ...state,
          [workoutName]: event.target.value,
        });
      };

    return (
        <div className="selectWorkout">
            <div className="selectWorkout__header">
                <h2 className="selectWorkout__header-title">Workout Name</h2>
                <NativeSelect
                    className="select"
                    value={"state.age"}
                    onChange={handleChange}
                    inputProps={{
                        name: 'age',
                        id: 'age-native-helper',
                    }}>
                    {/* <option aria-label="None" value="" /> */}
                    <option value={10}>Ten</option>
                    <option value={20}>Twenty</option>
                    <option value={30}>Thirty</option>
                </NativeSelect>
            </div>
            <div>

            </div>
        </div>
    );
}

export default SelectWorkout;
